import React from "react";
import { useDrop } from "react-dnd";
interface IRenderItem {
  item: String;
}
function Team({ team: team }: IRenderItem): void {
  const [drop, DropTarget] = useDrop(() => ({
    accept: "employee",
    drop: (item) => {
      console.log(item, "itemmm");
    },
    collect: (monitor) => ({
      isOver: !!monitor.isOver(),
    }),
  }));

  return (
    <div className="team" key={team.id} ref={drop}>
      <div> {team.Name} </div>
    </div>
  );
}

export default Team;
